import React from 'react';

const Container = (props, {styles}) => {
    return (
        <div className="container-fluid px-0" style={{
            background: 'rgba(29, 29, 35, 1)',
            paddingBottom: '5rem',
            paddingTop: '5rem',
            ...styles
        }}>
            {props}
        </div>
    )
}

export default Container;
